import React from 'react';

function Form() {
  return (
    <div>
      <h2>US immigration process</h2>
      <form>
        <div>
          <label htmlFor="countryOfBirth">Country of Birth:</label>
          <input type="text" id="countryOfBirth" name="countryOfBirth" />
        </div>

        <div>
          <label htmlFor="streetNumber">Street Number and Name:</label>
          <input type="text" id="streetNumber" name="streetNumber" />
        </div>

        {/* Add more form fields here */}

        <div>
          <button type="submit">Submit</button>
        </div>
      </form>
    </div>
  );
}

export default Form;
